import React from "react";
import JumboData from '../fixtures/jumbo.json';
import { Jumbotron } from '../components';

export function JumbotronContainer() {
    return (
        <Jumbotron.Container>
         {JumboData.map(item => (
             <Jumbotron key={item.id} direction={item.direction}>
                <Jumbotron.Pane>

                </Jumbotron.Pane>
             </Jumbotron>
         ))}
        </Jumbotron.Container>
    )
}
